@Funkywallot "(especially the Climate Hysterics)"  As an engineer, I'm curious to see what you consider this to be?  I'll give you my little writeup for the weak of mind.


Lets first look at this from incoming light. The Sun, with an effective temperature of approximately 5800 K, is an approximate black body with an emission spectrum peaked in the central, yellow-green part of the visible spectrum. Of that, about 55% of incoming sunlight to Earth is infrared photons. They strike the Earth and are reradiated back out into the atmosphere. The other 45% is white light and of that, about 30% of that is reflected which is what you would see if you were to look at the Earth from outer space. That should leave about 31.5% of the total light being white, to strike the Earth and be reradiated in the Earth's black body 255k infrared range back into the atmosphere. That would mean 55% infrared photons coming in and 86.5% total infrared photons going out. As we increase secondary greenhouse gases, CO2, CH4, O3, N2O, CFCs, and HCFCs, in the atmosphere, we block more incoming infrared photons, slightly cooling off the planet. Being there are more outgoing infrared photons than incoming, we should trap more outgoing infrared photons than reflecting incoming photons. That being said, all things being equal, on the mean, the planet must heat.


Read and understand the three laws of thermodynamics and then I'll be happy to explain any questions you have.

@Funkywallot Fossil Fuels are not a problem. China and India are building massive amounts of these plants using American technology (American companies are directly involved in building many of them). These new power plants are "clean coal" Ultra Supercritical power plants which are highly efficient (50% or more), and more environmentally friendly with far less harmful emissions released. 


Americans invented this technology, and unfortunately Obama killed it, before even a single plant could be built in America (there is one in Kentucky which is sort of a pilot plant that went online in 2013 I believe, and not as efficient as the latest Super Ultracritical technology). 


But China as we know, is also a world leader in Solar, and the largest producer (by far) of Solar panels, inverters, batteries, and other related technologies. Other nations also (including India) are making efforts to minimize their fossil fuel usage. But it is not a problem anyway. Clean/Renewable energy is not what people think it is. Global Warming is a fraud and a fallacy. We cannot allow a false dialectic to use $Trillions of tax dollars and make the financial elite (bankers and Big Oil men) who invented this scam/Conspiracy to make $Billions from it, while brainwashing the masses, controlling societies, and costing us all more money we don't have.   @t    @t       @t
